function setStateChangeCallback(callback) {
    if (typeof mraid !== typeof undefined) {
        var onStateChange = function() {
            callback(mraid.getState() !== "hidden")
        }
        mraid.addEventListener("stateChange", onStateChange);
    } else {
        console.error('mraid is undefined');
    }
}

function startGame(startGame) {
    if(typeof mraid !== typeof undefined) {
        if (mraid.getState() === "loading") {
            var onReadyCallback = function() {
                mraid.removeEventListener("ready", onReadyCallback);
                startGame();
            }
            mraid.addEventListener("ready", onReadyCallback);
        }
        else {
            startGame();
        }
    } else {
        console.error('mraid is undefined');
        startGame();
    }
}

function openStore(storeLink) {
    if(typeof mraid !== typeof undefined) {
        mraid.open(storeLink);
    } else {
        console.error('mraid is undefined');
    }
